import React from 'react';
import Card from '../Card/Card';

function Results(props) {
    return(
            <Card 
                title={props.data.title}
                author={props.data.authors}
                picture={props.data.thumbnail}
                synopsis={props.data.description}
                link={props.buyLink}
                key={props.id}
            />
    );
}

export default Results;
